/*
Last Updated : Rosnisa (31/1/2025)
Module : Wire Log
High Level Test Step :
1. Verify transaction that have Weekly Invoice Amount greater than funds received from client
*/
cy.get('table.k-grid-header-table.k-table.k-table-md', { timeout: 90000 }).should('exist');
cy.get('table tbody tr').each(($row) => {
    cy.wrap($row).within(() => {
        cy.get('td').then(($cells) => {
            const invoiceAmount = parseFloat($cells.eq(1).text().replace(/[$,]/g, ''));
            const fundsReceived = parseFloat($cells.eq(2).text().replace(/[$,]/g, ''));
            if (!isNaN(invoiceAmount) && !isNaN(fundsReceived)) {
                expect(invoiceAmount).to.be.greaterThan(fundsReceived);
                cy.log(`Transaction Verified: ${invoiceAmount} > ${fundsReceived}`);
            }
            else {
                cy.log(`Skipping row due to invalid values: ${$cells.eq(1).text()} | ${$cells.eq(2).text()}`);
            }
        });
    });
});

